%[text] # **Inputs**
%[text] #### *Scenarios*
% Select scenario to model
scenario = "lynx"; %[control:dropdown:36cc]{"position":[12,18]}
%[text] #### *Study site*
site = "west"; %[control:dropdown:0ef9]{"position":[8,14]}
% deer population attached to site
% Area in km2 attached to site selected
% density from site (density attached to site)
%[text] #### *Deer population*
% Red deer
red_recruit =0.34;% red deer birth rate %[control:slider:4b25]{"position":[14,18]}
red_morta =0.13;% red deer natural mortality rate %[control:slider:5635]{"position":[12,16]}
% Roe deer
roe_recruit =0.51;% red deer birth rate %[control:slider:83fd]{"position":[14,18]}
roe_morta =0.21;% red deer natural mortality rate %[control:slider:6342]{"position":[12,16]}
carrying_capa = 76;% estimate carrying capacity per km2 %[control:slider:9bb3]{"position":[17,19]}
%[text] #### *Hunting rate*
hunting_model = "site_hunt"; %[control:dropdown:5edf]{"position":[17,28]}
% if choose "Site hunting rate", hunting rate attached to site
% if choose "site hunting rate" the wolf poplation will goes extinct since
% red deer population isnt abundance enough to support them, you can select
% culling rate below or select culling rate change in "Scenario 2" box
current_redhunt = 0.12 ;% red deer culling rate (shouldn't exceed 0.12 in scenario 2) %[control:slider:186e]{"position":[19,23]}
current_roehunt = 0.05;% roe deer culling rate %[control:slider:54c8]{"position":[19,23]}
% calcualte new hunt rate
sport_hunting_rate = 0.06; % sport hunting rate (roe deer and red deer) %[control:slider:46f1]{"position":[22,26]}
%[text] #### *Time*
% Goals or specfic years
time_model = "specify"; %[control:dropdown:7ff4]{"position":[14,23]}
% goals
t = 2050 ;% 2030 goal or 2050 %[control:dropdown:8b35]{"position":[5,9]}
% specify year
spec_t = 2333;% years %[control:slider:0531]{"position":[10,14]}
%[text] ## Scenario 2
% Reintoduction of wolf in the park
wolf_ini_pop = 28; % no. of wolf that will be release %[control:slider:439a]{"position":[16,18]}
wolf_recruit = 0.55; % wolf birth rate %[control:slider:6e60]{"position":[16,20]}
wolf_morta = 0.21; % wolf natural mortality rate %[control:slider:16eb]{"position":[14,18]}
wolf_red_hunting = 27; % no of red deer hunted by 1 wolf per year %[control:slider:414a]{"position":[20,22]}
wolf_roe_hunting = 2; % no of roe deer hunted by 1 wolf per year %[control:slider:52bd]{"position":[20,21]}
wolf_time_lag = 1; % time it takes for wolf to mature and hunt
wolf_carrying_capa = 0.11; % wolf carrying capacity per km2 %[control:slider:04b4]{"position":[22,26]}
% Culling rate change
culling_rate_change_wolf = "yes"; % change culling rate based on deer density %[control:dropdown:89e3]{"position":[28,33]}
%[text] ## Scenario 3
% Reintoduction of lynx in the park
lynx_ini_pop = 24; % no. of lynx that will be release %[control:slider:2af5]{"position":[16,18]}
lynx_recruit = 0.5; % lynx birth rate %[control:slider:9604]{"position":[16,19]}
lynx_morta = 0.2; % lynx natural mortality rate %[control:slider:4bd7]{"position":[14,17]}
lynx_red_hunting = 10; % no of red deer hunted by 1 lynx per year %[control:slider:7a5c]{"position":[20,22]}
lynx_roe_hunting = 63; % no of red deer hunted by 1 lynx per year %[control:slider:45f2]{"position":[20,22]}
lynx_time_lag = 1; % time it takes for lynx to mature and hunt
lynx_carrying_capa = 0.11; % lynx carrying capacity per km2 %[control:slider:7175]{"position":[22,26]}
% Culling rate change
culling_rate_change_lynx = "no"; % change culling rate based on deer density %[control:dropdown:2081]{"position":[28,32]}
%[text] # Storage Variables
% storage variables
if time_model == "specify"
    t = spec_t;
end
generation = linspace(2019,t,t-2019+1);
red_pop = zeros(size(generation));
red_den = zeros(size(generation));
roe_pop = zeros(size(generation));
red_hind = zeros(size(generation));
red_stag = zeros(size(generation));
roe_den = zeros(size(generation));
veg_pressure = zeros(size(generation));
sapling_survival = zeros(size(generation));
woodland_area = zeros(size(generation));
operation = zeros(size(generation));
fencing = zeros(size(generation));
other = zeros(size(generation));
monitoring = zeros(size(generation));
vehicle = zeros(size(generation));
disease = zeros(size(generation));
venison = zeros(size(generation));
sporting = zeros(size(generation));
rent = zeros(size(generation));
tourism = zeros(size(generation));
gain = zeros(size(generation));
loss = zeros(size(generation));
econ_sum = zeros(size(generation));
wolf_pop = zeros(size(generation));
lynx_pop = zeros(size(generation));
acquires = zeros(size(generation));
collars = zeros(size(generation));
enclosures = zeros(size(generation));
vetss = zeros(size(generation));
field_bios = zeros(size(generation));
field_equips = zeros(size(generation));
data_supports = zeros(size(generation));
admin_overheads = zeros(size(generation));
edus = zeros(size(generation));
%[text] # Data & Calculation
% area in km2 & density & population (2019 data)
if site == "west"
    area = 64524/100;
    red_stag_den = 7.8;
    red_hind_den = 9.1;
    red_calve_den = 3.3;
elseif site == "east"
    area = 141964/100;
    red_stag_den = 4.8;
    red_hind_den = 5.9;
    red_calve_den = 2.0;
elseif site == "cai"
    area = 128168/100;
    red_stag_den = 1.4;
    red_hind_den = 1.9;
    red_calve_den = 0.7;
elseif site == "mon"
    area = 43643/100;
    red_stag_den = 3.9;
    red_hind_den = 4.7;
    red_calve_den = 1.2;
end

% calculations
all_red_den = red_stag_den+red_hind_den+red_calve_den;
red_stag_pop = red_stag_den*area;
red_hind_pop = red_hind_den*area;
red_clave_pop = red_calve_den*area;
all_red_pop = red_stag_pop+red_hind_pop+red_clave_pop;
all_roe_pop = all_red_pop*0.875;
all_roe_den = all_red_den*0.875;
all_density = all_red_den+all_roe_den;
all_population = all_red_pop+all_roe_pop;
og_redhunt = current_redhunt;

% hunting rate to site selected
if hunting_model == "site_hunt"
    if site == "west"
        current_redhunt = 0.171;
        current_roehunt = 0.019;
    elseif site == "east"
        current_redhunt = 0.362;
        current_roehunt = 0.108;
    elseif site == "cai"
        current_redhunt = 0.108;
        current_roehunt = 0.051;
    elseif site == "mon"
        current_redhunt = 0.114;
        current_roehunt = 0.013;
    end
end

redstag_hunt = current_redhunt*0.57;
redhind_hunt = current_redhunt*0.43;

% Current forest coverage in site selected in ha
if hunting_model == "site_hunt"
    if site == "west"
        forest_cover = 3344;
    elseif site == "east"
        forest_cover = 16163;
    elseif site == "cai"
        forest_cover = 25089;
    elseif site == "mon"
        forest_cover = 9550;
    end
end

% Annual deer management cost/income per deer (m)
operation_cost = 42.6/593000;
fencing_cost = 4.8/593000;
other_cost = 0.8/593000;
monitoring_cost = 1.5/593000;
vehicle_cost = 13.8/593000;
disease_cost = 0.5/593000;
venison_income = 7.5/593000;
sporting_income = 7.1/593000;
rent_income = 3/593000;
tourism_income = 0.1/593000;

% Reintroduction costs (m)
% Initial cost
% per wolf
accuire_transport = 0.01; % Acquisition and transport (per wolf)
collar = 0.002145; % Collars cost (per wolf)
% total
release_enclosure = 0.025; % Release enclosers/oversight (Total)
vets = 0.01; % Health checks/vets (Total)
% staff cost
field_bio = 0.04; % Field Biologist/ Ranger
field_equip = 0.0075; % Field equipment
data_support = 0.01; % Data support
admin_overhead = 0.01; % Admin overhead
edu = 0.02; % Educational outreach

fir_time_lag = 20;
sex_ratio_model = "no"; %[control:dropdown:96c4]{"position":[19,23]}
%[text] # Run Model (Start from 2019)
% deer population prediction
if scenario == "baseline"
    for i = 1:size(generation,2)    
        if i == 1   
            red_pop(i) = all_red_pop;
            red_den(i) = all_red_den;
            roe_pop(i) = all_roe_pop;
            roe_den(i) = all_roe_den;
            red_stag(i) = red_stag_pop;
            red_hind(i) = red_hind_pop;
        else
            if sex_ratio_model == "no"
                if carrying_capa == 0
                    red_pop(i) = red_pop(i-1)+(red_pop(i-1)*red_recruit)-(red_pop(i-1)*red_morta)-(red_pop(i-1)*current_redhunt)-(red_pop(i-1)*sport_hunting_rate);
                    red_den(i) = red_pop(i)/area;
                    roe_pop(i) = roe_pop(i-1)+(roe_pop(i-1)*roe_recuit)-(roe_pop(i-1)*roe_morta)-(roe_pop(i-1)*current_roehunt)-(roe_pop(i-1)*sport_hunting_rate);
                    roe_den(i) = roe_pop(i)/area;
                else
                    red_pop(i) = red_pop(i-1)+(red_pop(i-1)*red_recruit)-(red_pop(i-1)*red_morta)-(red_pop(i-1)*current_redhunt)-(red_pop(i-1)*sport_hunting_rate);
                    red_den(i) = red_pop(i)/area;
                    roe_pop(i) = roe_pop(i-1)+(roe_pop(i-1)*roe_recruit*(1-roe_pop(i-1)/(carrying_capa*area)))-(roe_pop(i-1)*roe_morta)-(roe_pop(i-1)*current_roehunt)-(roe_pop(i-1)*sport_hunting_rate);
                    roe_den(i) = roe_pop(i)/area;
                end
            else
                if carrying_capa == 0
                    red_stag(i) = red_stag(i-1)+(red_stag(i-1)*red_recruit)-(red_stag(i-1)*red_morta)-(red_stag(i-1)*redstag_hunt);
                    red_hind(i) = red_hind(i-1)+(red_hind(i-1)*red_recruit)-(red_hind(i-1)*red_morta)-(red_hind(i-1)*redhind_hunt);
                    red_pop(i) = red_pop(i-1)+(red_pop(i-1)*red_recruit)*(red_hind(i-1)/red_pop(i-1))-(red_pop(i-1)*red_morta)-(red_pop(i-1)*current_redhunt)-(red_pop(i-1)*sport_hunting_rate);
