                    roe_pop(i) = roe_pop(i-1)+(roe_pop(i-1)*roe_recuit)-(roe_pop(i-1)*roe_morta)-(roe_pop(i-1)*current_roehunt)-(roe_pop(i-1)*sport_hunting_rate)-(roe_pop(i-1)*sport_hunting_rate);
                    roe_den(i) = roe_pop(i)/area;
                else
                    red_stag(i) = red_stag(i-1)+(red_stag(i-1)*red_recruit)-(red_stag(i-1)*red_morta)-(red_stag(i-1)*redstag_hunt);
                    red_hind(i) = red_hind(i-1)+(red_hind(i-1)*red_recruit*(1-roe_pop(i-1)/(carrying_capa*area)))-(red_hind(i-1)*red_morta)-(red_hind(i-1)*current_redhunt);
                    red_pop(i) = red_pop(i-1)+(red_pop(i-1)*red_recruit)*(red_hind(i-1)/red_pop(i-1))-(red_pop(i-1)*red_morta)-(red_pop(i-1)*current_redhunt)-(red_pop(i-1)*sport_hunting_rate);
                    red_den(i) = red_pop(i)/area;
                    roe_pop(i) = roe_pop(i-1)+(roe_pop(i-1)*roe_recuit*(1-roe_pop(i-1)/(carrying_capa*area)))-(roe_pop(i-1)*roe_morta)-(roe_pop(i-1)*current_roehunt)-(roe_pop(i-1)*sport_hunting_rate);
                    roe_den(i) = roe_pop(i)/area;
                end
            end
        end
    end

% scenario 2 deer/wolf model
