                            wolf_pop(i) = wolf_pop(i-1)+(wolf_pop(i-1)*wolf_recruit*(1-wolf_pop(i-1)/(wolf_carrying_capa*area)))-(wolf_pop(i-1)*wolf_morta)- (wolf_pop(i-1) * (1 - prey_availability / (red_pop(1))));
                            if wolf_pop(i) < 0
                               wolf_pop(i) = 0;
                            end
                            red_pop(i) = red_pop(i-1)+(red_pop(i-1)*red_recruit)-(red_pop(i-1)*red_morta)-(red_pop(i-1)*current_redhunt)-(wolf_pop(i)*wolf_red_hunting)-(red_pop(i-1)*sport_hunting_rate);
