                                red_pop(i) = 0;
                            end
                            red_den(i) = red_pop(i)/area;
                            roe_pop(i) = roe_pop(i-1)+(roe_pop(i-1)*roe_recruit*(1-roe_pop(i-1)/(carrying_capa*area)))-(roe_pop(i-1)*roe_morta)-(roe_pop(i-1)*current_roehunt)-(wolf_pop(i)*wolf_roe_hunting)-(roe_pop(i-1)*sport_hunting_rate);
                            if roe_pop(i) < 0
                                roe_pop(i) = 0;
                            end
                            roe_den(i) = roe_pop(i)/area;
                        end
                    else
                       if carrying_capa == 0 || wolf_carrying_capa == 0
