                            wolf_pop(i) = wolf_pop(i-1)+(wolf_pop(i-1)*wolf_recruit)-(wolf_pop(i-1)*wolf_morta)- (wolf_pop(i-1) * (1 - prey_availability / (red_pop(1))));
                            if wolf_pop(i) < 0
                               wolf_pop(i) = 0;
                            end
                            red_pop(i) = red_pop(i-1)+(red_pop(i-1)*red_recruit)-(red_pop(i-1)*red_morta)-(red_pop(i-1)*current_redhunt)-(wolf_pop(i-wolf_time_lag)*wolf_red_hunting)-(red_pop(i-1)*sport_hunting_rate);
                            if red_pop(i) < 0
                                red_pop(i) = 0;
                            end
                            red_den(i) = red_pop(i)/area;
                            roe_pop(i) = roe_pop(i-1)+(roe_pop(i-1)*roe_recruit)-(roe_pop(i-1)*roe_morta)-(roe_pop(i-1)*current_roehunt)-(wolf_pop(i-wolf_time_lag)*wolf_roe_hunting)-(roe_pop(i-1)*sport_hunting_rate);
                            if roe_pop(i) < 0
                                roe_pop(i) = 0;
                            end
                            roe_den(i) = roe_pop(i)/area;
                        else
                            prey_availability = red_pop(i-1);
                            wolf_pop(i) = wolf_pop(i-1)+(wolf_pop(i-1)*wolf_recruit*(1-wolf_pop(i-1)/(wolf_carrying_capa*area)))-(wolf_pop(i-1)*wolf_morta)- (wolf_pop(i-1) * (1 - prey_availability / (red_pop(1))));
                            if wolf_pop(i) < 0
                               wolf_pop(i) = 0;
                            end
                            red_pop(i) = red_pop(i-1)+(red_pop(i-1)*red_recruit)-(red_pop(i-1)*red_morta)-(red_pop(i-1)*current_redhunt)-(wolf_pop(i-wolf_time_lag)*wolf_red_hunting)-(red_pop(i-1)*sport_hunting_rate);
                            if red_pop(i) < 0
                                red_pop(i) = 0;
                            end
                            red_den(i) = red_pop(i)/area;
                            roe_pop(i) = roe_pop(i-1)+(roe_pop(i-1)*roe_recruit*(1-roe_pop(i-1)/(carrying_capa*area)))-(roe_pop(i-1)*roe_morta)-(roe_pop(i-1)*current_roehunt)-(wolf_pop(i-wolf_time_lag)*wolf_roe_hunting)-(roe_pop(i-1)*sport_hunting_rate);
                            if roe_pop(i) < 0
                                roe_pop(i) = 0;
                            end
                            roe_den(i) = roe_pop(i)/area;
                        end
                    end
                end
        else
            if i == 1   
                red_pop(i) = all_red_pop;
                red_den(i) = all_red_den;
                roe_pop(i) = all_roe_pop;
                roe_den(i) = all_roe_den;
                red_stag(i) = red_stag_pop;
                red_hind(i) = red_hind_pop;
