                if i <= wolf_time_lag
                    if carrying_capa == 0 || wolf_carrying_capa == 0
                        prey_availability = red_pop(i-1);
                        wolf_pop(i) = wolf_pop(i-1)+(wolf_pop(i-1)*wolf_recruit)-(wolf_pop(i-1)*wolf_morta)- (wolf_pop(i-1) * (1 - prey_availability / red_pop(1)));
                        if wolf_pop(i) < 0
