                        roe_pop(i) = roe_pop(i-1)+(roe_pop(i-1)*roe_recruit)-(roe_pop(i-1)*roe_morta)-(roe_pop(i-1)*current_roehunt)-(wolf_pop(i-wolf_time_lag)*wolf_roe_hunting)-(roe_pop(i-1)*sport_hunting_rate);
                        if roe_pop(i) < 0
                            roe_pop(i) = 0;
                        end
