% Woodland prediction
for i = 1:size(generation,2)
    if i == 1
        woodland_area(i) = forest_cover;
        if deer_den(i) > 50
            sapling_survival(i) = 1-0.45;
            veg_pressure(i) = 0.45;
        elseif deer_den(i) > 25 && deer_den(i) < 50
            sapling_survival(i) = 1-0.39;
            veg_pressure(i) = 0.39;
        elseif deer_den(i) > 15 && deer_den(i) < 25
            sapling_survival(i) = 1-0.1;
            veg_pressure(i) = 0.1;
        elseif deer_den(i) > 8 && deer_den(i) < 15
            sapling_survival(i) = 1-0.08;
            veg_pressure(i) = 0.08;
        elseif deer_den(i) < 8
            sapling_survival(i) = 1-0.05;
            veg_pressure(i) = 0,05;
        end
   else
        if deer_den(i) > 50
            woodland_area(i) = woodland_area(i-1);
            sapling_survival(i) = 1-0.45;
            veg_pressure(i) = 0.45;
        elseif deer_den(i) > 25 && deer_den(i) < 50
            woodland_area(i) = woodland_area(i-1)+(woodland_area(i-1)*0.012);
            sapling_survival(i) = 1-0.39;
            veg_pressure(i) = 0.39;
        elseif deer_den(i) > 15 && deer_den(i) < 25
            woodland_area(i) = woodland_area(i-1)+(woodland_area(i-1)*0.017);
            sapling_survival(i) = 1-0.1;
            veg_pressure(i) = 0.1;
