% accumulative annual economic gain/loss
for i = 1:size(generation,2)
    if i == 1
        gain(i) = venison(i)+sporting(i)+rent(i)+tourism(i);
        loss(i) = operation(i)+fencing(i)+other(i)+monitoring(i)+vehicle(i)+disease(i)+acquires(i)+collars(i)+enclosures(i)+vetss(i)+field_bios(i)+field_equips(i)+data_supports(i)+admin_overheads(i)+edus(i);
        econ_sum(i) = gain(i)-loss(i);
    else
        gain(i) = gain(i-1)+venison(i)+sporting(i)+rent(i)+tourism(i);
        loss(i) = loss(i-1)+operation(i)+fencing(i)+other(i)+monitoring(i)+vehicle(i)+disease(i)+acquires(i)+collars(i)+enclosures(i)+vetss(i)+field_bios(i)+field_equips(i)+data_supports(i)+admin_overheads(i)+edus(i);
        econ_sum(i) = gain(i)-loss(i);
    end
end

